CREATE DATABASE IF NOT EXISTS `d2r` DEFAULT CHARACTER SET utf8;

USE `d2r`;

DROP TABLE IF EXISTS `product`;
CREATE TABLE `product` (
  `nr` int(11) primary key,
  `label` varchar(100) character set utf8 collate utf8_bin default NULL,
  `comment` varchar(2000) character set utf8 collate utf8_bin default NULL,
  `producer` int(11) default NULL,
  `propertyNum1` int(11) default NULL,
  `propertyNum2` int(11) default NULL,
  `propertyNum3` int(11) default NULL,
  `propertyNum4` int(11) default NULL,
  `propertyNum5` int(11) default NULL,
  `propertyNum6` int(11) default NULL,
  `propertyTex1` varchar(200) character set utf8 collate utf8_bin default NULL,
  `propertyTex2` varchar(200) character set utf8 collate utf8_bin default NULL,
  `propertyTex3` varchar(200) character set utf8 collate utf8_bin default NULL,
  `propertyTex4` varchar(200) character set utf8 collate utf8_bin default NULL,
  `propertyTex5` varchar(200) character set utf8 collate utf8_bin default NULL,
  `propertyTex6` varchar(200) character set utf8 collate utf8_bin default NULL,
  `publisher` int(11) default NULL,
  `publishDate` date default NULL,
  INDEX USING BTREE (producer)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

LOCK TABLES `product` WRITE;
ALTER TABLE `product` DISABLE KEYS;

